    "level-ii-contaminant-investigation-of-overflow-national-wildlife-refuge-wilmot-arkansas",nt"isopen":
    false,nt"url": null,nt"notes": "Conductivity and turbidity exhibited the
    greatest variation of the water quality parameters measured at Overflow NWR and
    the proposed acquisition land (Table 2). Highest values for both conductivity and
    turbidity were found at Flat Slough (site 11) inside the current refuge boundaries.
    The lowest values were found in Overflow Creek within the refuge boundary (site
    1). Only three organochlorine compounds (DDD, DDE, and DDT) were detected in the
    sediment collections (Table 3). More organochlorine compounds were identified at
    or above detection limits in the bottom feeding fishes compared to the predator
    fishes (Table 4). Concentrations of mercury and selenium in sediments were all less
    that 1 ug/g (dry weight); however, concentrations of mercury and selenium in fish
    tissue were all at or above 1 ug/g (Table 5).",nt"license_title": "License
